import ConceptsItem from "./ConceptsItem"

function Concepts(props) {
  return (
    <ul id="concepts">
      <ConceptsItem></ConceptsItem>
      <li className="concept">
        <img src={props.concepts[0].image} alt={props.concepts[0].image} />
        <h2>{props.concepts[1].title}</h2>
        <p>{props.concepts[1].description}</p>
      </li>
      <li className="concept">
        <img src={props.concepts[0].image} alt={props.concepts[0].image} />
        <h2>{props.concepts[2].title}</h2>
        <p>{props.concepts[2].description}</p>
      </li>
    </ul>
  );
}

export default Concepts;
